import React, { useEffect } from 'react'

const Home = () => {
  useEffect(() => {
    fetch('http://localhost:3000/api/stashpoints')
      .then((response) => {
        console.log(response.json())
      })
      .catch((err) => console.log(err))
  }, [])

  return (
    <div>
      <h1>Home</h1>
    </div>
  )
}

export default Home
